export default L.icon({
  iconSize: [60, 80],
  iconAnchor: [29, 80],
  popupAnchor: [2, -40],
  iconUrl: "https://unpkg.com/browse/leaflet@1.3.4/dist/images/marker-icon.png",
  shadowUrl: "https://unpkg.com/leaflet@1.6/dist/images/marker-shadow.png"
});
